// Libs
import React from 'react';
import styled from 'styled-components';

//Styles
const Container = styled.div`
  width: 18rem;
  height: 20rem;
  border: 1px solid;
  border-radius: 8px;
`;

const Image = styled.div`
  width: 20px;
  height: 20px;
  background-color: red;
`;

const Card = () => (
  <Container>
    <Image />
  </Container>
)

export default Card;
